- input: "TEXT\x1CC00372862\x1C.TEXT\x1C\x1CF3XA\x1CPursuant to the letter dated March
    7, 2011, it was noted that more than $5,000 was contributed to Friends of Jim
    Oberstar for the 2010 General Election. I had notated that the $3,000 check written
    8/14/09 was for G-2010, as well as a disbursement made on 10/26/10 for $5,000.
    \ I've amended this form to reflect the correction of my clerical error, in classifying
    the $3,000 disbursement incorrectly: the amended form is now correctly marked
    as a contribution for the 2009 Primary election, thereby not exceeding the $5,000
    threshold for a General election contribution.  Please note that the dollar amounts
    for successive reports have not been changed, as the error was only a coding issue.
    Please contact me should you have any questions.\n"
